NodeJS RESTful API Import/Require dilemma<p>I'm currently working on my first <strong>node.js/express rest API</strong> and I ran into an issue.</p>
<p>I use <strong>mongoose</strong> to build Schemas, and one of those Schemas requires data (for validation porpuses) from its origin DataBase.</p>
<p>Now I have an import dilemma because at the time I import the Schemas, there is not yet a binding to the DataBase. I tried to import the models from <code>server.js</code>to request Data from the DB. However, I got an error that the model I tried to import is undefined. Hence the Connection to the DB in server.js is not yet established at the time of import.</p>
<p>This here is my <code>server.js</code>, I require the Schemas from <code>./api/models/newsClassificationHubModel</code> As you can see at the time I import the <code>Schemas</code> I didn't establish the required connection.</p>
<pre><code>//server.js

const express = require(&quot;express&quot;),
    app = express(),
    port = process.env.PORT || 3000,
    mongoose = require(&quot;mongoose&quot;),
    schemas = require(&quot;./api/models/newsClassificationHubModel&quot;),
    bodyParser = require(&quot;body-parser&quot;);

// mongoose instance connection url
mongoose.Promise = global.Promise;
TagHubClusterConnection = mongoose.createConnection(&quot;mongodb+srv://admin:##########@cluster0.yzl7d.mongodb.net/textClassHub?retryWrites=true&amp;w=majority\n&quot;,
    { useNewUrlParser: true, useUnifiedTopology: true });

// export models with custom connections
exports.devSentence = TagHubClusterConnection.model(&quot;newSentence_DB&quot;, schemas.registerNewSentence)
exports.devTagBase = TagHubClusterConnection.model(&quot;baseTag_DB&quot;, schemas.registerNewBaseTag)
exports.devTagChild = TagHubClusterConnection.model(&quot;childTag_DB&quot;, schemas.registerNewChildTag)

app.use(bodyParser.urlencoded({extended: true}));
app.use(bodyParser.json());

const routes = require(&quot;./api/routes/newsClassHubRoutes&quot;);
routes(app); // register the route

app.listen(port, &quot;localhost&quot;,function() {
    console.log(&quot;server is listening on http://localhost:&quot; + port)
})

</code></pre>
<p>Here you can see a shortened version of the <code>Schema</code> defenition in <code>./api/models/newsClassificationHubModel</code>,  At this point, I would need to do a request to the DB to get the <code>valid tags</code> from the DB</p>
<pre><code>// newsClassificationHubModel.js (Schemas) 

const mongoose = require(&quot;mongoose&quot;);
const Schema = mongoose.Schema;

// get validTags from DB
let validTags = []


// Schema definition
const registerNewChildTag = new Schema({
    tagID: {
        type: String,
        required: true
    },
    tagName: {
        type: String,
        required: true
    },
    description: {
        type: String,
        validate: [lengthValidator, &quot;Please enter a description with min 30 characters&quot;],
        required: true
    },
    childTag: {
        type: String,
        enum: {
            values: validTags,
            message: &quot;Please enter a valid tagID&quot;
        },
        required: true
    }
});

exports.registerNewChildTag = mongoose.model(&quot;childTag_DB&quot;, registerNewChildTag);

</code></pre>
<p>I believe I could use A <code>promise</code> to solve that problem, yet I don't know how to do it exactly.</p>
<p>I appreciate any hint from anyone, and If something is unclear please don't hesitate to ask for a better explanation</p>
<p>BreadBerry</p>

