actix web with mongodb project fails to build after an async call to mongodb is added<p>I'm implementing a REST API using actix-web and mongodb for the data back-end. I am using version 1.1.1 of the official rust-mongodb driver from crates.io and Rust 1.46.</p>
<p>If I add code to make a call to the mongodb collection to get records for example, even though <code>cargo check</code> shows no errors or warnings, <code>cargo build</code> takes a long time and then terminates with an error that it could not compile my project and a <code>(signal 9, SIGKILL: kill)</code>. After searching for the problem, I get that this is probably an out of memory error caused during the build/linking process. I am working on a Debian 10 machine with 16GB of RAM, so this is not very reasonable.</p>
<p>This only happens when I make the call in code inside a &quot;handler&quot; using <code>async</code> and <code>await</code>.</p>
<p>For example, if I try to get the names of the sample collection like so:</p>
<pre><code>pub async fn samples() -&gt; Result&lt;HttpResponse, Error&gt; {
    let dbnames = get_samples().await;

    Ok(HttpResponse::Ok().json(dbnames.unwrap()))
}

async fn get_samples() -&gt; Result&lt;Vec&lt;String&gt;, ServiceError&gt; {
    let mut dbnames: Vec&lt;String&gt; = Vec::new();
    let client_uri = String::from(&quot;mongodb+srv://&lt;...MONGODB_CONNECTION_INFO...&gt;/sample_mflix?retryWrites=true&amp;w=majority&quot;);
    let client = mongodb::Client::with_uri_str(client_uri.as_ref()).await?;

    for name in client.list_database_names(None, None).await? {
        dbnames.push(format!(&quot;- {}&quot;, name));
    }

    Ok(dbnames)
}
</code></pre>
<p>The <code>cargo build</code> will never complete and will stop with the aforementioned error.</p>
<p>Just to make sure, I used code to get the sample collection names, directly inside main.rs in the main function and it worked with no issues and the compile and build time were reasonable.</p>
<pre><code>let client = mongodb::Client::with_uri_str(client_uri.as_ref()).await;
println!(&quot;Databases:&quot;);
for name in client.unwrap().list_database_names(None, None).await {
    for item in name {
        println!(&quot;- {}&quot;, item);
    }
}
</code></pre>
<p>Same result even if use <code>cargo build --release</code> to avoid having too much debug info</p>
<p>This only happens when using the async API of the rust-mongodb driver. With the sync API everything build and works properly.</p>
<p>What could be the cause of this?</p>

