MongoDB Index Coverage with complicated query<p><strong>Mongo DB Version 3.4.6</strong></p>
<p>I have a collection with a document structure which resembles the following:</p>
<pre><code>{
  organization: &quot;ABC123&quot;,
  tags: [&quot;MARTHA WASHINGTON&quot;, &quot;+15552082000&quot;],
  updatedAt : ISODate(&quot;2020-10-09T17:19:44.861Z&quot;),
  createdAt : ISODate(&quot;2020-01-14T19:46:15.957Z&quot;),
}
</code></pre>
<p>I need to be able to query by organization and a regex &quot;starts with&quot; on the tags array, and optionally sort by updatedAt or createdAt.  To accomplish this, I created the following index:</p>
<pre><code>{
    &quot;organization&quot; : 1,
    &quot;tags&quot; : 1,
    &quot;createdAt&quot; : -1
}
</code></pre>
<p>This is a multikey compound index which based on my understanding of Mongo should allow me to cover the query in all cases.  If I execute a query like:</p>
<pre><code>db.getCollection('data').find({&quot;organization&quot;: &quot;ABC123&quot;, &quot;search&quot;: /^MARTHA WASHINGTO/})
</code></pre>
<p>The query is covered by the index - I see a single FETCH/IXSCAN stage.</p>
<p>Likewise, if I remove the regex query and add a sort - the query is perfectly covered.</p>
<pre><code>db.getCollection('data').find({&quot;organization&quot;: &quot;ABC123&quot;, &quot;search&quot;: &quot;MARTHA WASHINGTON&quot;}).sort({&quot;createdAt&quot;:-1})
</code></pre>
<p>However, if I <strong>combine</strong> the regex and sort options, suddenly I see an extra SORT stage in my query.  Example query:</p>
<pre><code>db.getCollection('data').find({&quot;organization&quot;: &quot;ABC123&quot;, &quot;search&quot;: /^MARTHA WASHINGTO/}).sort({&quot;createdAt&quot;:-1})
</code></pre>
<p>Here is the winning plan output from the explain:</p>
<pre><code>&quot;winningPlan&quot; : {
            &quot;stage&quot; : &quot;SORT&quot;,
            &quot;sortPattern&quot; : {
                &quot;createdAt&quot; : -1.0
            },
            &quot;inputStage&quot; : {
                &quot;stage&quot; : &quot;SORT_KEY_GENERATOR&quot;,
                &quot;inputStage&quot; : {
                    &quot;stage&quot; : &quot;FETCH&quot;,
                    &quot;inputStage&quot; : {
                        &quot;stage&quot; : &quot;IXSCAN&quot;,
                        &quot;keyPattern&quot; : {
                            &quot;organization&quot; : 1,
                            &quot;tags&quot; : 1,
                            &quot;createdAt&quot; : -1
                        },
                        &quot;indexName&quot; : &quot;tag matches by organization&quot;,
                        &quot;isMultiKey&quot; : true,
                        &quot;multiKeyPaths&quot; : {
                            &quot;organization&quot; : [],
                            &quot;search&quot; : [ 
                                &quot;search&quot;
                            ],
                            &quot;createdAt&quot; : []
                        },
                        &quot;isUnique&quot; : false,
                        &quot;isSparse&quot; : false,
                        &quot;isPartial&quot; : false,
                        &quot;indexVersion&quot; : 2,
                        &quot;direction&quot; : &quot;forward&quot;,
                        &quot;indexBounds&quot; : {
                            &quot;organization&quot; : [ 
                                &quot;[\&quot;ABC123\&quot;, \&quot;ABC123\&quot;]&quot;
                            ],
                            &quot;tags&quot; : [ 
                                &quot;[\&quot;MARTHA WASHINGTON\&quot;, \&quot;MARTHA WASHINGTOO\&quot;)&quot;, 
                                &quot;[/^MARTHA WASHINGTON/, /^MARTHA WASHINGTON/]&quot;
                            ],
                            &quot;createdAt&quot; : [ 
                                &quot;[MaxKey, MinKey]&quot;
                            ]
                        }
                    }
                }
            }
        },
</code></pre>
<p>I am stumped about why this combination of queries is not being covered by the index.  My understanding is that the extra sort stage at the beginning will result in slow performance for large collections.  Can anyone provide some guidance? Is there some limitation that I've missed?</p>
<p><strong>Update: winning plan when the regex query is removed</strong></p>
